import cv2
import numpy as np
import pandas as pd
from google.colab.patches import cv2_imshow
import matplotlib.pyplot as plt
from mpl_toolkits import mplot3d
from sklearn.cluster import KMeans
from kneed import KneeLocator

img = cv2.imread('hogwarts.jpg')

cv2_imshow(img)

w, h = img.shape[:2]

(B, G, R) = cv2.split(img)

R = np.reshape(R, w*h)
G = np.reshape(G, w*h)
B = np.reshape(B, w*h)

cor = [(R[i]/255, G[i]/255, B[i]/255) for i in range(w*h)]

df = pd.DataFrame(data={'R': R, 'G': G, 'B': B}, columns=['R', 'G', 'B'])

ax = plt.axes(projection ="3d")
ax.scatter3D(df.R, df.G, df.B, color = cor)
plt.show()

X = df.to_numpy()

Y = []
for i in range(2, 30):
  kmeans = KMeans(n_clusters=i, random_state=0).fit(X)
  Y.append(kmeans.inertia_)

plt.plot(range(2, 30), Y)

knee = KneeLocator(range(2, 30), Y, curve="convex", direction="decreasing").elbow
knee

knee=15

kmeans = KMeans(n_clusters=knee, random_state=0).fit(X)
labels = kmeans.labels_

copia = X.copy()

for i in range(knee):
  c = X[labels == i]
  print(f'cluster {i}')
  r = c[:,0].mean()
  g = c[:,1].mean()
  b = c[:,2].mean()
  cor_media = np.zeros((28,28,3), np.uint8)
  cv2.rectangle(cor_media, (0, 0), (28, 28), (b, g, r), -1)
  cv2_imshow(cor_media)
  copia[labels == i] =  (b, g, r)
  print(b, g, r)

copia = np.reshape(copia, (w, h, 3))

cv2_imshow(copia)